import React, { Component } from 'react';
import PageLogo from './PageLogo'
import { Row, Button} from 'react-bootstrap';

class LandingPage extends Component {
  render() {
    return (
      <div className="banner-gradient text-center">
        <Row className="justify-content-center">
            <PageLogo />
        </Row>

            <Row className="justify-content-center text-center">
                <p className="typewriter  shadow py-2">Hello, I am Randy</p>
              </Row>
              <Row className="justify-content-center text-center ">
                 <p className="typewriter other py-2 mb-5 shadow-lg">Full Stack Web Developer<span   className="blinker">|</span></p> 
              </Row>
              <Button className=" button-banner mb-5" size="lg" variant="outline-light">View Projects</Button>
       </div>

    );
  }
}

export default LandingPage;
